import Wrapper from '../components/page-wrapper';
import fetch from 'isomorphic-unfetch';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCoffee } from '@fortawesome/free-solid-svg-icons';

const Home = (prop) => (
    <Wrapper title="Home">
        <div style={{textAlign: 'center'}}>
       <h1>Yernemm</h1>
       <h2>Creating web tools since 2016</h2>
       <h3>just for fun.</h3>
       <FontAwesomeIcon icon={faCoffee} size='xs' />
       </div>
       <br/>
       <h1><b>Links</b></h1>  
        <div>
            <div>
                <a href="https://twitter.com/Yernemm" className="fab fab-btn fa-twitter w3-card-4"></a>
                <a href="https://www.youtube.com/channel/UCfOGXFJdLqnhfENzTCC9IjA/featured" className="fab fab-btn fa-youtube w3-card-4"></a>
                <a href="https://www.reddit.com/user/yernemm" className="fab fab-btn fa-reddit w3-card-4"></a>
                <a href="https://github.com/Yernemm/" className="fab fab-btn fa-github w3-card-4"></a>
                <a href="https://discord.gg/uqhkBt8" className="fab fab-btn fa-discord w3-card-4"></a>
                <a href="https://discord.gg/wFbJZqC" className="fab fab-btn w3-card-4" style={{backgroundColor: "#d5855c"}}><img style={{maxHeight: "50px", width: "auto"}} src="/static/media/icons/brigitte.png"/></a>
              
              </div>
            </div>
</Wrapper>
)

Home.getInitialProps = async function(){
    const res = await fetch('https://docs.google.com/document/d/e/2PACX-1vRF2ZkT94svdc3ya1UQOPQCkaXnAPflIhBvVnMoj-N-UY2TdBH-khGU3S5Ef8ycGnK6JAV8FMeY6Thb/pub?embedded=true');
    const data = await res.text();

    

    let out = {data: data, body: data.split("</head>")[1].split("</html>")[0].replace("<body", "<div").replace("</body", "</div") };
    
    console.log(out);
    
    
    return out;
    
  
}


export default Home;
